import React from "react";
import homeImg from "../assets/home-bg.jpg";
import "../App.css";

export default function Home() {
  return (
    <div className="page-wrap">
      <div className="hero">
        <img src={homeImg} alt="home" className="hero-img" />
        <div className="hero-text">
          <h2>Welcome to Mobile Shop</h2>
          <p>Buy phones, accessories, and request repairs easily.</p>
        </div>
      </div>
    </div>
  );
}
